import React from "react";
import '../App.css';
import { Router, Route, Switch } from 'react-router-dom';
import history from '../history';
import NavBar from "./Layout/NavBar";
import Home from "./Home";
import Prices from "./Prices";
import SignUpUserOrRider from "./OptionsComponent/SignUpUserOrRider";
import SignInUserOrRider from "./OptionsComponent/SignInUserOrRider";
import SignUpUser from "./Auth/SignUpUser";
import SignUpRider from "./Auth/SignInRider";
import SignInUser from "./Auth/SignInUser";
import SignInRider from "./Auth/SignUpRider";
import SignUpAdmin from "./Auth/SignUpAdmin";
import SignInAdmin from "./Auth/SignInAdmin";
import UserDashboardHome from "./Dashboard/UserDashboardHome";
import UserDashboardPayment from "./Dashboard/UserDashboardPayment";
import UserDashboardPending from "./Dashboard/UserDashboardPending";
import UserDashboardOrders from "./Dashboard/UserDashboardOrders";
import RiderDashboardHome from "./Dashboard/RiderDashboardHome";
import RiderDashboardPayments from "./Dashboard/RiderDashboardPayment"
RiderDashboardPending
RiderDashboardOrders
AdminDashboardPayment
AdminDashboardHome
AdminDashboardHome
AdminDashboardHome
import Footer from "./Layout/Footer";

const App = () => {
    return(
        <div>
           <Router history={history}>
              <NavBar />

              <Switch>
                <Route exact path="/" component={Home} />
                <Route path="/home" component={Home} />
                <Route path="/prices" component={Prices} />

                <Route path="/signupuserorrider" component={SignUpUserOrRider} />
                <Route path="/signinuserorrider" component={SignInUserOrRider} />

                <Route path="/signupuser" component={SignUpUser} />  
                <Route path="/signuprider" component={SignUpRider} />  

                <Route path="/signinuser" component={SignInUser} />  
                <Route path="/signinrider" component={SignInRider} />

                <Route path="/vwxyzsignupadmin" component={SignUpAdmin} />
                <Route path="/signinadmin" component={SignInAdmin} />

                <Route path="/userdashboardhome" component={UserDashboardHome} />
                <Route path="/userdashboardpayment" component={UserDashboardPayment} />
                <Route path="/userdashboardpending" component={UserDashboardPending} />
                <Route path="/userdashboardorderhistory" component={UserDashboardOrders} />

                <Route path="/riderdashboardhome" component={RiderDashboardHome} />
                <Route path="/riderdashboardpayment" component={RiderDashboardPayment} />
                <Route path="/riderdashboardpendingortracking" component={RiderDashboardPending} />
                <Route path="/riderdashboardorderhistory" component={RiderDashboardOrderHistory} />

                <Route path="/admindashboardhome" component={AdminDashboardHome} />
                <Route path="/admindashboardpayment" component={AdminDashboardPayment} />
                <Route path="/admindashboardtracking" component={AdminDashboardTracking} />
                <Route path="/admindashboardhistory" component={AdminDashboardHistory} />
              </Switch>

              <Footer />
           </Router>
        </div>
    )
}

export default App;
